import React from 'react';
import {useQuery} from '@apollo/react-hooks';
import gql from 'graphql-tag';

const MY_PRODUCTS = gql`
  query MY_PRODUCTS {
      user{
        id
        username
        email
        products{
          id
          name
          description
          price
          imageUrl
        }
      }
    }

`


const UserProducts = () => {
  const { data, loading, error} = useQuery(MY_PRODUCTS)
  return (
    <div>
      User Products
    </div>
  )
}

export default UserProducts
